const word = 'abcdefghijklmnopqrstuvwxyz';

let original = [];
let resposta = [];
let amostras = [];

let arvre = {'filhos':[]};

let removeAcento = (l) => {
    return [...new Set(l.map((x) => x.toLowerCase().replace(new RegExp('[ÁÀÂÃ]','gi'), 'a')
        .replace(new RegExp('[ÉÈÊ]','gi'), 'e')
        .replace(new RegExp('[ÍÌÎ]','gi'), 'i')
        .replace(new RegExp('[ÓÒÔÕ]','gi'), 'o')
        .replace(new RegExp('[ÚÙÛ]','gi'), 'u')
        .replace(new RegExp('[Ç]','gi'), 'c'))
        .sort())]
}

let porcentagem = (valor, l) => {
    return 100 * (valor/l.length);
}

let pegaFrequencia = (l) => {
    let frequencia = [];
    
    for (let i of Array.from(word)){
        let letra = {letra: i}

        letra.palavras = l.filter((x) => x.includes(i)).length;
        letra.frequencia = l.map((x) => ocorrencias(x, i)).reduce((count, atual) => count + atual);

        letra.lugar = [];
        for (let j = 0; j < 5; j++) {
            letra.lugar.push(l.filter((x) => x.charAt(j) == i).length);
        }

        frequencia.push(letra);
    }

    return frequencia;
}

let ordenado = (f) => {
    return f.map((x) => x.letra).join('').toUpperCase();
}

let listarCaminhos = (caminho) => {
    if(caminho.length >= 5) {
        return [caminho];
    }  else {
        let response = [];
        return response.concat(
            listarCaminhos(caminho + 'I'),
            listarCaminhos(caminho + 'E'),
            listarCaminhos(caminho + 'N')
        )
    }
}

let hasDupes = (palavra) => {
   return palavra.split('').some((v, i, a) => a.lastIndexOf(v) !== i);
}

let ocorrencias = (palavra, letra) => {
    return palavra.split(letra).length - 1;
}

let makeArvore = (lista) => {
    arvre = {'filhos':[]};
    lista.forEach(palavra => {
        adicionaNo(arvre, palavra, 0)
    });
}

let adicionaNo = (pai, palavra, indice) => {
    if (palavra.length > indice) {
        let letra = palavra.charAt(indice);
        
        if(!pai.filhos.some(e => e.letra === letra)) {
            pai.filhos.push({
                'letra': letra,
                'filhos': []
            });
        }
        
        adicionaNo(pai.filhos.filter(e => e.letra == letra)[0], palavra, indice + 1);
    }
}

let dfs = (arvore, palavra, caminho, lista, indice) => {
    if (lista.length == 0) {
        return [];
    } else if (indice >= 5) {        
        let filtro = {'W':[],'N':[]}

        for (let i = 0; i < 5; i++) {
            let k = {'posicao': i, 'letra': palavra.charAt(i)};

            if (caminho.charAt(i) == 'N') {
                filtro.N.push(k);
            } else {
                filtro.W.push(k);
            }
        }

        filtro.W.forEach((x) => {
            let igual = filtro.W.filter(w => w.letra == x.letra);
            lista = lista.filter(f => (ocorrencias(f, x.letra) >= igual.length))
        })

        filtro.N.forEach(x => {
            let igual = filtro.W.filter(w => w.letra == x.letra);
            lista = lista.filter(f => ((ocorrencias(f, x.letra) == igual.length) && !(f.includes(x.letra))))
        })

        return (lista.length > 0) 
            ? [{'palavra': palavra, 'caminho': caminho, 'universo': lista.length}] 
            : [];
    }

    let response = [];
    
    arvore.filhos.forEach(no => { 
        let letra = no.letra
        let igual = lista.filter(x => x.charAt(indice) == letra);
        let existe = lista.filter(x => (x.charAt(indice) != letra) && (x.includes(letra)));
        let inexiste = lista.filter(x => x.charAt(indice) != letra);
    
        response = [
            ...response,
            ...dfs(no, palavra + letra, caminho + 'I', igual, indice + 1),
            ...dfs(no, palavra + letra, caminho + 'E', existe, indice + 1),
            ...dfs(no, palavra + letra, caminho + 'N', inexiste, indice + 1)
        ];        
    });

    return response;
}

let qPalavra = (palavra, caminho, lista, indice) => {
    if (lista.length == 0) {
        return []
    } else if (indice >= 5) {
        if(caminho.includes('N') && hasDupes(palavra)){
            let filtro = {'W':[],'N':[]}

            for (let i = 0; i < 5; i++) {
                let k = {'posicao': i, 'letra': palavra.charAt(i)};

                if (caminho.charAt(i) == 'N') {
                    filtro.N.push(k);
                } else {
                    filtro.W.push(k);
                }
            }

            filtro.W.forEach((x) => {
                let igual = filtro.W.filter(w => w.letra == x.letra);
                lista = lista.filter(f => (ocorrencias(f, x.letra) >= igual.length))
            })

            filtro.N.forEach(x => {
                let igual = filtro.W.filter(w => w.letra == x.letra);
                lista = lista.filter(f => (ocorrencias(f, x.letra) == igual.length))
            })
        }

        return (lista.length > 0) ? [{'caminho':caminho, 'universo': lista.length}] : [];
    } else {
        let letra = palavra.charAt(indice);
        let igual = lista.filter(x => x.charAt(indice) == letra);
        let existe = lista.filter(x => (x.charAt(indice) != letra) && (x.includes(letra)));

        let inexiste = (ocorrencias(palavra, letra) == 1) 
            ? lista.filter(x => !(x.includes(letra))) 
            : lista.filter(x => x.charAt(indice) != letra);

        return [
            ...qPalavra(palavra, caminho + 'I', igual, indice + 1),
            ...qPalavra(palavra, caminho + 'E', existe, indice + 1),
            ...qPalavra(palavra, caminho + 'N', inexiste, indice + 1),
        ]
    }
}

let casos = (q) => {
    let casos = q.sort((a, b) => b.universo - a.universo);
    
    return {
        // 'melhor': porcentagem(casos.filter((x) => x.universo == 1).length, q),
        'pior': casos[0].universo,
        'quantidade': casos.length,
        'aritmetico': casos.reduce((count, atual) => count + atual.universo, 0)/casos.length,
        'quadradico': Math.pow(casos.reduce((count, atual) => count + Math.pow(atual.universo, 2), 0)/casos.length, 0.5),
        'geometrico': Math.pow(casos.reduce((count, atual) => count * parseInt(atual.universo), 1), (1/casos.length))
    }
}

let filtra = (tentativa, validade) => {
    resposta = filtraPorResposta(tentativa, validade, resposta);
    return resposta;
}

let filtraPorResposta = (tentativa, validade, lista) => {
    let final = [...lista];
    let filtro = {'I':[],'E':[],'N':[]}

    for (let i = 0; i < 5; i++) {
        filtro[validade.charAt(i)].push({
            'posicao': i,
            'letra': tentativa.charAt(i)
        });
    }

    filtro.W = filtro.I.concat(filtro.E)

    // Palavras que não contem a letra determinada na posição correta
    filtro.I.forEach((x) => {
        final = final.filter((f) => f.charAt(x.posicao) == x.letra);
    })

    // Palavras que contem a letra determinada, porém em outra posição
    filtro.E.forEach((x) => {
        final = final.filter((f) => f.includes(x.letra) && (f.charAt(x.posicao) != x.letra));
    })

    filtro.N.forEach((x) => {
        let igual = filtro.W.filter((w) => w.letra == x.letra);
        
        if (igual.length == 0) {
            // A palavra não inclui aquela letra
            final = final.filter((f) => !(f.includes(x.letra)))
        } else {
            // A palavra inclui aquela letra, mas em menor quantidade
            final = final.filter((f) => (ocorrencias(f, x.letra) == igual.length) && (f.charAt(x.posicao) != x.letra))
        }
    })
        
    return final;
}

